import React from 'react'

export default function ShowTrails(props) {
  return (
    <div>
      <h3>Trails</h3>
      {props.trails.map((trail) => (
        <div class="card">
        <p>{trail.name}</p>
        <p>{trail.difficulty}</p>
          <p>{trail.travel_time_from_NYC} minutes</p>
          </div>
      ))}
    </div>
  )
}
